import { Wrap, Inner, CTA } from "./styles";

export const Footer = () => {
  const year = new Date().getFullYear();
  return (
    <Wrap>
      <Inner>
        <div>
          © {year} Inteligência Financeira S.A. • Todos os direitos reservados.
        </div>
        <CTA href="/contato">Quero começar agora</CTA>
      </Inner>
    </Wrap>
  );
};
